.giftCard-container {
  height: 100%;
  font-size: 30px;
  padding: 20px;
  .giftCard_wrap {
    margin-bottom: 20px;
    padding: 15px 20px 20px;
    background-color: #ffffff;
    border-radius: 14px;
    .title {
      font-size: 28px;
