      margin-bottom: 60px;
      .g_cardBox {
        width: 156px;
        height: 195px;
        font-size: 24px;
        background-color: #fdf8d2;
        border-radius: 14px;
        border: solid 2px #f7d6c2;
        cursor: pointer;
        .cR_listImg {
          width: 86px;
          height: 123px;
          margin: 15px auto;
          display: block;
        }
        .g_tips {
          font-size: 24px;
          font-weight: normal;
          font-stretch: normal;
          line-height: 28px;
          letter-spacing: 0px;
          color: #c78054;
          text-align: center;
        }
        &.active {
          border: solid 2px #eb114f;
        }
      }
    }
  }
  .re_address {
    .re_text {
      font-size: 25px;
      font-weight: normal;
      font-stretch: normal;
      line-height: 28px;
      letter-spacing: 0px;
      color: #494b4f;
      margin-bottom: 20px;
    }
    :deep(.van-cell) {
      height: 61px;
      border-radius: 7px;
      border: solid 1px #787f8c;
      padding: 0 15px;
      .van-field__body {
        height: 100%;
      }
    }
  }
  .button_gc {
    width: 100%;
    margin-top: 50px;
    .van-button {
      width: 407px;
      height: 69px;
      margin: 0 auto;
      display: block;
      background: url('../../../assets/images/activity/send.png');
      background-size: cover;
      border: unset;
    }
  }
}

